import React from 'react';
import ReactDOM from 'react-dom';
// import App from './App';

let curTime = new Date().toLocaleTimeString;

ReactDOM.render(
    <div>
    <h1>{curTime}</h1>
    <button>Click Me</button>
    </div>,
    document.getElementById('root')
);
